# https://leetcode.com/problems/number-of-submatrices-that-sum-to-target/

from pprint import pprint
from typing import List


class Solution:

    def numSubmatrixSumTarget(self, matrix: List[List[int]], target: int) -> int:
        return 0

    # 多少メモ化したところでTLE
    def numSubmatrixSumTarget2(self, matrix: List[List[int]], target: int) -> int:
        l = len(matrix)
        m = len(matrix[0])
        memo = {}
        ans = 0

        def subsum(i, j) -> int:
            i1, j1 = divmod(i, m)
            i2, j2 = divmod(j, m)
            i1 = min(i1, i2)
            i2 = max(i1, i2)
            j1 = min(j1, j2)
            j2 = max(j1, j2)
            keystr = "{}:{},{}:{}".format(i1, j1, i2, j2)
            print("{}:{} -> {}".format(i, j, keystr))
            if keystr in memo:
                return -1
            subans = 0
            for i in range(i1, i2 + 1):
                lkeystr = "{}:{},{}:{}".format(i, j1, i, j2)
                if lkeystr in memo:
                    subans += memo[lkeystr]
                    continue
                lsubans = 0
                for j in range(j1, j2 + 1):
                    subans += matrix[i][j]
                    lsubans += matrix[i][j]
                memo[lkeystr] = subans
            
            memo[keystr] = subans
            return subans


        for i in range(l * m):
            for j in range(i, l * m):
                if subsum(i, j) == target:
                    ans += 1
            
        return ans


